        StringMsgParser myParser = new StringMsgParser();
        ArrayBlockingQueue<SIPMessage> queue = new ArrayBlockingQueue(10000);
        //content-length 黏包
        String f1 = "";
        String f01 = "";
        String f2 = "";
        String f3 = "";
        String f4 = "";
        String f5 = "";
        String f6 = "";
        String f7 = "";
        String f8 = "";
        String f9 = "";
        String f10 = "";

        //Content-legth

        queue.add(myParser.parseSIPMessage(hexStringToString(f1 + f01 + f2 + f3 + f4 + f5 + f6 + f7 + f8 + f9 + f10)));



        String s1 = "";
        String s2 = "";
        String s3 = "";
        String s4 = "";
        String s5 = "";
        String s6 = "";
        String s7 = "";
        String s8 = "";
        String s9 = "";
        String s10 = "";
